  // Private variable - khng th access t bn ngoi
  #accessToken: string | null = null;

  set(token: string) {
    this.#accessToken = token; //  V8 Heap
  }

  get(): string | null {
    return this.#accessToken;
  }

  clear() {
    this.#accessToken = null;
  }
